import React, { Component} from'react'
import axios from 'axios'

class StorageGraft extends Component{
    constructor(props){
        super(props);
        this.state={
            Aggregate:[],
            Svm:[],
        }
    }
    getBar(){
        <div className="progress">
            <div className="progress-bar progress-bar-striped bg-success"
                 role="progressbar"
                 style={{width:1000}}>
                        {100}%
            </div>
        </div>
    }
    render(){
        return(
                this.getBar()
            );
    }

}
export default StorageGraft
